for ticker in symbols:
    try:
        url = requests.get('http://www.traderscockpit.com/?pageView=rsi-indicator-rsi-chart&type=rsi&symbol={0}'.format(ticker), timeout=10)
        soup = bs4.BeautifulSoup(url.text, features="html.parser")
        print("\nUpdating data for ", ticker, " ...........", end=" ")
        urls = soup.find_all("td", {'width': '12%'})
        dataToBeInserted = {}
        completeData = {}

        for i in range(len(urls)):
            try:
                if(i==9):
                    continue
                
                newData = []
                indicatorUrl = base_url + urls[i].find('a')['href']
                tempIndicatorUrl = requests.get(indicatorUrl, timeout = 15)
                tempSoup = bs4.BeautifulSoup(tempIndicatorUrl.text, features="html.parser")
                
                
                ###get the indicator name
                indicator = indicatorUrl.split("&type=")[1].split("&symbol=")[0]
                cursor = collection.find({"symbol":ticker})
                lastData = cursor[0]["data"][indicator][1]
                
                
                Data = tempSoup.find("div", {'class':'displayTableFrame'}).find("tbody").find_all("tr")
                for row in Data:
                    tempList = row.text.split("\n")[1:]
                    if(tempList != lastData):
                        newData.append(tempList)
                        continue
                    else:
                        tempString = "data.{0}".format(indicator)
                        collection.update_one({"symbol":ticker}, {'$push': {tempString:{'$each':newData, '$position':1} } } )
                        
                        break
                
            except Exception as e:
                print("\nError while scrapping - ", indicatorUrl, " :: ", e)
                continue
        print("Done!")
    except Exception as e:
        print(e)
        continue
